import React from "react";

const FormMobileOtp = () => {
    return(
        <div className="offer-form">
            <form>
                <div>
                <label>
                        Name:
                        <input type="text" name="name" />
                    </label>
                </div>

            <input type="submit" value="Submit" />
            </form>
        </div>
    )
}

export default FormMobileOtp;
